import React from 'react'
import Button from './button'
import styled from 'styled-components'

const Inner = styled.div`
  display: flex;
`

const Container = styled.div`
  display: flex;
`

const Options = () => {
  return (
    <Container>
      <Inner>
        <Button left />
        <Button />
      </Inner>
    </Container>
  )
}

export default Options
